* 5D프린팅기술적용 (5D 기술인 컴퓨터 합성 프린트기술이적용된 최종 업그레이드 버전).
* 외피소가죽, 내피는 송아지가죽.
* 정확한 색상구현.
* 쿠셔닝과 착화감.
* 로고폰트의 동기화작업 ☆☆☆☆☆.
* 남성용은 뒷축에 LOGO가 있지만, 여성 신발은 LOGO가 없습니다.
* 남성 신발은 앞코가 두 줄로 되어 있고 여성 신발은 한 줄로 마감되어있어요.
* 바늘땀과 적용된 실의 두께까지 동일.
* 바닥구멍 TPU소재의 내마모발포 (내마모지진).
*위조방지기술 및 코드적용.
* 신발 형광 위조방지선.
* 중하부선 외측 홀로그램.
* 위조방지깔창중하부 반딧불아래 두개의 원점.
.
