□반품/교환규정□

* 제품 불량및 파손의경우 수령후 24시간내로 

연락주셔야 교환으로만 가능합니다. 그이후는 고객님부주의로 간주합니다. 

*퀄리티부분은 아무리설명드려도 주관적인부분이 강하기때문에 퀄리티불만족으로인한 반품/교환 절대 불가합니다. 

*미세한 스크래치,냄새,바느질,색상,마감처리 박스찌그러짐,등등으로 반품/교환 절대불가! 많이 예민하신 분들은 백화점을 이용해주세요. 

*단순변심 및 개봉후 사용제품은 반품/교환 절대 불가합니다. *의류, 신발의 경우 사이즈로인한 반품/교환 불가합니다.
.
