해배 2~3주내외(배송비:무료)

국배 3~5일 (배송비:무료) 

*해배는 간혹 세관지연으로인해 조금더 기간이 소요될 수 있습니다. 이는 저희관할이아니라 국가적 통관문제이며, 교환환불사항에 해당되지않습니다. 

*국내배송제품은 제목에 별도표기해놓았으며 따로써있지않는 제품은 전부 해배입니다( 저희샵 대부분이 해배이고 일부만 국배입니다).
